import React from 'react'
import {
    Box, Paper, Button, withStyles, makeStyles, Table, TableBody, TableCell,
    TableContainer, TableHead, TableRow, TableSortLabel
} from '@material-ui/core';
import data from './resources/names'


const useStyles = makeStyles({
    table: {
        width: "50%",
    },
    paper: {
        background: "white",
    },
    container: {
        maxHeight: 440,
      },
    button: {    
        padding: '30px',   
      },
});

const StyledTableCell = withStyles((theme) => ({
    head: {
        backgroundColor: theme.palette.common.black,
        color: theme.palette.common.white,
    },
    body: {
        fontSize: 14,
    },
}))(TableCell);

export const NameTable = () => {

    const classes = useStyles;

    const names = data.names;

    const totalAmount = 100;

    console.log(names[0]);

    return (



            <Paper className={classes.paper}>

                <Button className={classes.button} variant="outlined" color="primary">
                    Order by name
    </Button>
                <Button className={classes.button} variant="outlined" color="primary" disabled={!false}>
                    Order by amount
    </Button>



                <TableContainer className={classes.container}>
                    <Table className={classes.table} aria-label="simple table">
                        <TableHead>
                            <TableRow>
                                <StyledTableCell>Name</StyledTableCell>
                                <StyledTableCell align="right">Amount</StyledTableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {names.map((s, i) => (
                                <TableRow key={i}>
                                    <TableCell component="th" scope="row">
                                        {s.name}
                                    </TableCell>
                                    <TableCell align="right">{s.amount}</TableCell>
                                </TableRow>
                            ))}
                            <TableRow>
                                <StyledTableCell>Total</StyledTableCell>
                                <StyledTableCell align="right">{totalAmount}</StyledTableCell>
                            </TableRow>
                        </TableBody>
                    </Table>
                </TableContainer>

            </Paper>


    );
};
